import React from "react";
import VideoItem from "./VideoItem";

function VideoList(props) {
  console.log(props);
  return (
    <ul className="video-list">
      {props.videos.map((eachVideo) => {
        <VideoItem />;
      })}
    </ul>
  );
}

export default VideoList;
